css:
@-moz-document domain("redanianintelligence.com") {
body {
    background-color: #111;
}


.blog-post-title h2, .blog-post-title h2 a, h1, h2, h3, h4, h5, h6, .comment-meta .comment-author, .comment-reply-title, .entry-author .author-title, .section-heading h2 {
    color: #b9b9b9;
}

.blog-posts-listing .post.sticky, .blog-post-single-nav-button, .comment-navigation a, .blog-post-single-pagination a, .blog-post-single-pagination p>span, .pagination a, .pagination span.current, #infinite-handle span, #footer-posts {
    background-color: #000000;
}

.blog-post-alt-title h2 {
    color:#b9b9b9;
}

.timeline-Widget {
    background-color: #1b1b1b;
}

.SandboxRoot {
    color: #b9b9b9;
}

.comment-body {
    background: #1b1b1b;
}

body {
    color: #b9b9b9;
}

a.comment-like-link {
    color: #fff;
}

.comment-respond {
    background-color: #1b1b1b;
}

.timeline-Header-title {
    color: #b9b9b9;
}
}
